import React from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';

// Import Layout & Pages
import Navbar from './components/Navbar';
import LandingPage from './pages/LandingPage';
import ProtectedRoute from './components/ProtectedRoute'; // Import the helper
import LoginPage from './pages/LoginPage';
import SignupPage from './pages/SignupPage';
import DashboardPage from './pages/DashboardPage'; // <-- NEW
import RecipeListPage from './pages/RecipeListPage';
import RecipeDetailPage from './pages/RecipeDetailPage';
import RecipeForm from './pages/RecipeForm';
import MealPlanListPage from './pages/MealPlanListPage';
import MealPlanDetailPage from './pages/MealPlanDetailPage';
import ProfilePage from './pages/ProfilePage';
import DietLogPage from './pages/DietLogPage'; 
import IngredientListPage from './pages/IngredientListPage'; 
import IngredientForm from './pages/IngredientForm'; 

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      {/* This div adds the top padding and background color */}
      <div className="page-content"> 
        <Routes>
          {/* Public Routes */}
          <Route path="/login" element={<LoginPage />} />
          <Route path="/signup" element={<SignupPage />} />

          {/* Protected Routes (Main App) */}
          <Route 
            path="/dashboard" 
            element={<ProtectedRoute><DashboardPage /></ProtectedRoute>} 
          />
          <Route 
            path="/recipes" 
            element={<ProtectedRoute><RecipeListPage /></ProtectedRoute>} 
          />
          <Route 
            path="/recipes/:id" 
            element={<ProtectedRoute><RecipeDetailPage /></ProtectedRoute>} 
          />
          <Route 
            path="/recipes/new" 
            element={<ProtectedRoute><RecipeForm /></ProtectedRoute>} 
          />
          <Route 
            path="/recipes/edit/:id" 
            element={<ProtectedRoute><RecipeForm /></ProtectedRoute>} 
          />
          <Route 
            path="/ingredients" 
            element={<ProtectedRoute><IngredientListPage /></ProtectedRoute>} 
          />
           <Route 
            path="/ingredients/new" 
            element={<ProtectedRoute><IngredientForm /></ProtectedRoute>} 
          />
           <Route 
            path="/ingredients/edit/:id" 
            element={<ProtectedRoute><IngredientForm /></ProtectedRoute>} 
          />
          <Route 
            path="/mealplans" 
            element={<ProtectedRoute><MealPlanListPage /></ProtectedRoute>} 
          />
           <Route 
            path="/mealplans/:id" 
            element={<ProtectedRoute><MealPlanDetailPage /></ProtectedRoute>} 
          />
          <Route 
            path="/diet-logs" 
            element={<ProtectedRoute><DietLogPage /></ProtectedRoute>} 
          />
           <Route 
            path="/profile" 
            element={<ProtectedRoute><ProfilePage /></ProtectedRoute>} 
          />
          
          {/* Default Route: Redirect to dashboard if logged in, or login if not */}
          <Route 
            path="/" 
            element={<ProtectedRoute><Navigate to="/dashboard" replace /></ProtectedRoute>} 
          />
          <Route 
            path="*" 
            element={<Navigate to="/" replace />} 
          />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
